import React from 'react'

const TodosList = ({todos, setTodos}) => {
    return (
        <div>
            {todos.map((todo) => (
                <li 
                className = "list-item"
                key = {todo.id}>
                    <input 
                    type="text"
                    value = {todo.title}
                    onChange = {(e) => e.preventDefault()}
                    />
                </li>
            )
            )}
        </div>
    )
}

export default TodosList;
